[[package]]
name = "proxy-scraper-checker"
version = "0.0.0"
source = { editable = "." }
dependencies = [
    { name = "aiofiles" },
    { name = "aiohttp" },
    { name = "aiohttp-socks" },
    { name = "attrs" },
    { name = "brotli", marker = "implementation_name == 'cpython'" },
    { name = "brotlicffi", marker = "implementation_name != 'cpython'" },
    { name = "certifi" },
    { name = "charset-normalizer" },
    { name = "maxminddb" },
    { name = "platformdirs" },
    { name = "rich" },
    { name = "tomli", marker = "python_full_version < '3.11'" },
    { name = "winloop", marker = "(implementation_name == 'cpython' and sys_platform == 'cygwin') or (implementation_name == 'cpython' and sys_platform == 'win32')" },
]

[package.optional-dependencies]
non-termux = [
    { name = "aiodns" },
    { name = "uvloop", marker = "(implementation_name == 'cpython' and sys_platform == 'darwin') or (implementation_name == 'cpython' and sys_platform == 'linux')" },
]

[package.dev-dependencies]
dev = [
    { name = "mypy", extra = ["faster-cache"] },
    { name = "ruff" },
    { name = "tomli" },
    { name = "types-aiofiles" },
    { name = "typing-extensions" },
]
nuitka = [
    { name = "nuitka" },
]

[package.metadata]
requires-dist = [
    { name = "aiodns", marker = "extra == 'non-termux'", specifier = ">=1.1,<4" },
    { name = "aiofiles" },
    { name = "aiohttp", specifier = ">=3.8.6,<4" },
    { name = "aiohttp-socks", specifier = ">=0.7,<0.10" },
    { name = "attrs", specifier = ">=22.2" },
    { name = "brotli", marker = "implementation_name == 'cpython'", specifier = ">=1,<2" },
    { name = "brotlicffi", marker = "implementation_name != 'cpython'", specifier = "<2" },
    { name = "certifi" },
    { name = "charset-normalizer", specifier = ">=2,<4" },
    { name = "maxminddb", specifier = ">=1.3,<3" },
    { name = "platformdirs", specifier = "<5" },
    { name = "rich", specifier = ">=12.3,<14" },
    { name = "tomli", marker = "python_full_version < '3.11'", specifier = "<3" },
    { name = "uvloop", marker = "(implementation_name == 'cpython' and sys_platform == 'darwin' and extra == 'non-termux') or (implementation_name == 'cpython' and sys_platform == 'linux' and extra == 'non-termux')", specifier = ">=0.14,<0.22" },
    { name = "winloop", marker = "(implementation_name == 'cpython' and sys_platform == 'cygwin') or (implementation_name == 'cpython' and sys_platform == 'win32')", specifier = "<0.1.7" },
]

[package.metadata.requires-dev]
